import React, {useEffect} from 'react';
import {Link} from 'react-router-dom';
import'./PopupEditPage.css';
import L from "leaflet";
import "leaflet/dist/leaflet.css";

function PopupEditPage(){

  useEffect(() => {

    var map = L.map('map_page').setView([10.7553411, 106.4150395], 5);

    var OpenStreetMap_Mapnik = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
    	maxZoom: 19,
    	attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    });
    OpenStreetMap_Mapnik.addTo(map);

    L.marker([10.7553411, 106.4150395]).addTo(map)
        .bindPopup('A pretty CSS3 popup.<br> Easily customizable.')
        .openPopup();
    console.log(map);
  }, []);

  const getMyAdress = () => {
    navigator.geolocation.getCurrentPosition(getLatLon);
  }

  function getLatLon(position) {
    var latitude = position.coords.latitude;
    var longitude = position.coords.longitude;
      console.log("Latitude is "+latitude);
      console.log("Longitude is "+longitude);
  }

  return(
    <div className="popup-edit-page">
      <div className="popup-edit-page-container">
        <div className="map-page-container">
          <h5>Chỉnh sửa vị trí cửa hàng <Link to="">ReactJS Việt Nam</Link></h5>
          <div id="map_page" className="map_page"></div>
          <div className="map-page-button">
            <button type="submit" onClick={getMyAdress}>Lấy vị trí của bạn</button>
            <button type="submit">Xác nhận</button>
          </div>
        </div>
      </div>
    </div>
  )
}

export default PopupEditPage;
